// Stripping out those already contacted.
require( 'contacted.php' );
$contacted = explode( ',', $contacted );
echo 'Initial count: ' . count( $potentials ) . "\n";
foreach ( $potentials as $key => $potential_driver ) {
	foreach ( $contacted as $contacted_driver ) {
		if ( $contacted_driver === $potential_driver ) {
			//echo $potential_driver . ',';
			unset( $potentials[ $key ] );
		}
	}
}

