// Strip existing drivers out.
$all_drivers = get_users( array( 'number' => 2000 ) );
foreach ( $all_drivers as $driver ) {
	$driver_id = $driver->ID;

	foreach ( $potentials as $key => $potential_driver ) {
		if ( $driver->data->display_name === $potential_driver ) {
			unset( $potentials[ $key ] );
		}
	}
}

